import './App.css';
import RenanLogo from './imagenes/Logo Renan.png'
import Boton from './Componentes/boton';

function App() {
  return (
    <div className="App">
      <div className="renan-logo-contenedor">
        <img className="renan-logo" src={RenanLogo} alt="Logo de renan"/>
      </div>
      <div className="contenedor-principal">
        <Boton texto="Click" esBotonDeClic={true}/>
        <Boton texto="Reiniciar" esBotonDeClic={false}/>
      </div>
    </div>
  );
}

export default App;
